import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useLocationData } from '../App';
import './HomePage.css';

function HomePage() {
    const { userLocation, locationName, isLoadingLocation, API_URL } = useLocationData();
    const [currentData, setCurrentData] = useState(null);
    const [prediction, setPrediction] = useState(null);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        if (userLocation) {
            fetchData();
        }
    }, [userLocation]);

    const fetchData = async () => {
        setLoading(true);
        try {
            // Fetch current AQI
            const currentRes = await fetch(`${API_URL}/current?lat=${userLocation.lat}&lon=${userLocation.lon}`);
            const currentJson = await currentRes.json();
            setCurrentData(currentJson);

            // Fetch prediction
            const predRes = await fetch(`${API_URL}/predict`);
            const predJson = await predRes.json();
            setPrediction(predJson);
        } catch (err) {
            console.error('Error fetching data:', err);
        }
        setLoading(false);
    };

    const getAQIClass = (aqi) => {
        if (aqi <= 50) return 'good';
        if (aqi <= 100) return 'moderate';
        if (aqi <= 150) return 'sensitive';
        if (aqi <= 200) return 'unhealthy';
        if (aqi <= 300) return 'very-unhealthy';
        return 'hazardous';
    };

    const getAQIEmoji = (aqi) => {
        if (aqi <= 50) return 'üòä';
        if (aqi <= 100) return 'üôÇ';
        if (aqi <= 150) return 'üòê';
        if (aqi <= 200) return 'üò∑';
        if (aqi <= 300) return 'ü§¢';
        return 'üíÄ';
    };

    if (isLoadingLocation || loading) {
        return (
            <div className="loading">
                <div className="spinner"></div>
                <p>Loading air quality data...</p>
            </div>
        );
    }

    return (
        <div className="home-page fade-in">
            {/* Hero Section */}
            <section className="hero">
                <div className="hero-content">
                    <h1 className="hero-title">
                        Real-Time Air Quality
                        <span className="hero-highlight"> Prediction</span>
                    </h1>
                    <p className="hero-subtitle">
                        AI-powered predictions using GA-KELM Machine Learning
                    </p>
                    <div className="hero-location">
                        üìç {locationName}
                    </div>
                </div>
            </section>

            {/* Quick Stats */}
            {currentData && (
                <section className="quick-stats">
                    <div className={`stat-card main-aqi ${getAQIClass(currentData.aqi)}`}>
                        <div className="stat-emoji">{getAQIEmoji(currentData.aqi)}</div>
                        <div className="stat-value">{currentData.aqi}</div>
                        <div className="stat-label">Current AQI</div>
                        <div className="stat-category">{currentData.category}</div>
                    </div>

                    {prediction && (
                        <div className={`stat-card prediction ${getAQIClass(prediction.AQI_Prediction)}`}>
                            <div className="stat-icon">üß¨</div>
                            <div className="stat-value">{Math.round(prediction.AQI_Prediction)}</div>
                            <div className="stat-label">GA-KELM Prediction</div>
                            <div className="stat-category">{prediction.category}</div>
                        </div>
                    )}

                    <div className="stat-card info">
                        <div className="stat-icon">üí®</div>
                        <div className="stat-value">{currentData.pm25}</div>
                        <div className="stat-label">PM2.5 (Œºg/m¬≥)</div>
                    </div>

                    <div className="stat-card info">
                        <div className="stat-icon">üå°Ô∏è</div>
                        <div className="stat-value">{currentData.pm10}</div>
                        <div className="stat-label">PM10 (Œºg/m¬≥)</div>
                    </div>
                </section>
            )}

            {/* Feature Cards */}
            <section className="features">
                <Link to="/current" className="feature-card">
                    <div className="feature-icon">üìä</div>
                    <h3>Current AQI</h3>
                    <p>View detailed air quality metrics, pollutant levels, and health advisories</p>
                    <span className="feature-link">View Details ‚Üí</span>
                </Link>

                <Link to="/prediction" className="feature-card">
                    <div className="feature-icon">üîÆ</div>
                    <h3>Prediction</h3>
                    <p>AI-powered forecasts using Genetic Algorithm Kernel ELM model</p>
                    <span className="feature-link">View Prediction ‚Üí</span>
                </Link>

                <div className="feature-card">
                    <div className="feature-icon">üåç</div>
                    <h3>Location-Based</h3>
                    <p>Real-time data fetched from OpenWeatherMap based on your location</p>
                    <span className="feature-link">Auto-Detected</span>
                </div>
            </section>

            {/* AQI Scale */}
            <section className="aqi-scale">
                <h2>AQI Scale Reference</h2>
                <div className="scale-items">
                    <div className="scale-item good">
                        <span className="scale-range">0-50</span>
                        <span className="scale-label">Good</span>
                    </div>
                    <div className="scale-item moderate">
                        <span className="scale-range">51-100</span>
                        <span className="scale-label">Moderate</span>
                    </div>
                    <div className="scale-item sensitive">
                        <span className="scale-range">101-150</span>
                        <span className="scale-label">Sensitive</span>
                    </div>
                    <div className="scale-item unhealthy">
                        <span className="scale-range">151-200</span>
                        <span className="scale-label">Unhealthy</span>
                    </div>
                    <div className="scale-item very-unhealthy">
                        <span className="scale-range">201-300</span>
                        <span className="scale-label">Very Unhealthy</span>
                    </div>
                    <div className="scale-item hazardous">
                        <span className="scale-range">301+</span>
                        <span className="scale-label">Hazardous</span>
                    </div>
                </div>
            </section>
        </div>
    );
}

export default HomePage;
